import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import Auth from '../Auth'
//import SlideShow from './images/SlideShow'

class Navbar extends Component {
    renderHeader(){
        if(localStorage.getItem("validToken")){
            return (
                <div className='ui secondary pointing menu'>
                <Link to='/home' className='item'>Home</Link>
                <Link to='/about'  className='ui button primary'>About Us</Link>
                <Link to='/contact' className='ui button grey'>Contact Us</Link>
                    <div className='right menu'>
                        <Link className='ui button left aligned button' to={`/post/list`}>Gallary</Link>
                        <Auth/>
                    </div>
                </div>    
            )   
        }else{
            return (
                <div className='ui secondary pointing menu'>
                    <Link to='/' className='item'><h1>Welcome to my website</h1> </Link>
                    <div className='right menu'>
                        <Auth />

                    </div>
                </div>
            )
        }

    }


  render () {
    return (
        <div>
            {this.renderHeader()}
            <SlideShow/>

        </div>
    )
  }
}

export default Navbar
